window.bookSummaryJSON = "<p><b>Now that the Darkness has tasted her, it won't let Emma go.</b></p> <p>Robbed of her memories, Emma feels like a ghost trapped in her own body. She doesn't remember much, but she knows one thing: something happened to her in Arnsmouth.</p> <p>Whatever had happened to her had been terrible. Desperate to learn the truth, she finds herself drawn to a nightclub known as The Flesh &amp; Boneâ€“a place that she knows might well lead to her certain death.</p> <p>Professor Raphael Saltonstall has a problem. Her name is Emma Mather.</p> <p>No matter what he does, no matter how hard he tries to stop her, she keeps charging headlong into danger. He did everything he could think of to protect her, and failed. So now he has to do all he can to keep her out of the hands of those who would use her to bring about the end of the world, even if it means her death at his hands.</p> <p>Unfortunately, the<i> things</i> that live inside him seem to have other plans for her...</p> <p><i>Of Flesh &amp; Bone </i>is book two of Tenebris, an occult horror romance series from <i>USA Today</i> bestselling author Kathryn Ann Kingsley. With wild twists, cult intrigue, and eldritch horrors that go bump in the night, it's sure to send shivers down your spine.</p> <p>It contains strong themes of madness and murder but guarantees an HEA. Also...there will be tentacles.</p>"; 
